// src/api/diary.js
import axios from 'axios';

// Récupération des entrées du journal de santé
export const getDiaryEntries = async () => {
  const response = await axios.get('/api/diary');
  return response.data;
};

// Ajout d'une nouvelle entrée au journal
export const addDiaryEntry = async (entry) => {
  const response = await axios.post('/api/diary', entry);
  return response.data;
};
